using System.Threading.Channels;
using Backend.Database;
using Backend.Database.Models;
using Backend.Extensions;
using Backend.Hubs;
using Backend.Services.Repositories;
using DataTransfer.Chat;
using Microsoft.AspNetCore.SignalR;

namespace Backend.Services.Background;

public class ChatMessageRelayService(
    IHubContext<CampaignUpdateHub, ICampaignUpdate> campaignUpdateHub,
    IUserConnectionTracker userConnectionTracker,
    Channel<(Campaign, User, ChatMessageDto)> chatMessageChannel) : BackgroundService
{
    protected override async Task ExecuteAsync(CancellationToken stoppingToken)
    {
        while (await chatMessageChannel.Reader.WaitToReadAsync(stoppingToken))
        {
            var (campaign, sender, chatMessage) = await chatMessageChannel.Reader.ReadAsync(stoppingToken);

            var isPrivate = chatMessage.ReceiverId is not null;

            var isSenderDungeonMaster = campaign.GameMaster == sender;
            var image = isSenderDungeonMaster ? _dungeonMasterIcon : string.Empty;
            
            var receiverMessageEventArgs = new ChatMessageEventArgs
            (
                DateTime.UtcNow,
                ChatMessageType.Message,
                MessageDirection.Received,
                sender.Username,
                chatMessage.Text,
                image,
                isPrivate
            );

            if (chatMessage.ReceiverId is { } receiverId)
            {
                if (campaignUpdateHub.Clients.UserInCampaign(campaign.Id, receiverId, userConnectionTracker) is
                    { } receiverClient)
                {
                    await receiverClient.ChatMessageReceived(receiverMessageEventArgs);
                }
            }
            else
            {
                await campaignUpdateHub.Clients
                    .AllInCampaignExcept(campaign.Id, sender.Id, userConnectionTracker)
                    .ChatMessageReceived(receiverMessageEventArgs);
            }

            var senderMessageEventArgs = receiverMessageEventArgs with
            {
                Image = null,
                Direction = MessageDirection.Sent,
            };

            if (campaignUpdateHub.Clients.UserInCampaign(campaign.Id, sender.Id, userConnectionTracker) is
                { } senderClient)
            {
                await senderClient.ChatMessageReceived(senderMessageEventArgs);
            }
        }
    }

    private static readonly string _dungeonMasterIcon =
        "data:image/jpeg;base64,";
}